import React from 'react';

function Certificate() {
  return (
    <section id="certificates">
      <h2>Certificates</h2>
      <div>
        <img src="https://via.placeholder.com/200x150" alt="Certificate 1" />
        <img src="https://via.placeholder.com/200x150" alt="Certificate 2" />
        <img src="https://via.placeholder.com/200x150" alt="Certificate 3" />
      </div>
    </section>
  );
}

export default Certificate;
